import Typography from "@mui/material/Typography";

import axios from "axios";

import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Box from "@mui/material/Box";

import { useEffect, useState } from "react";

import * as React from "react";

import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(entry_id, created_at, updated_at, name) {
  return { entry_id, created_at, updated_at, name };
}

const columns = [
  { field: "entry_id", headerName: "ID", width: 70 },
  { field: "created_at", headerName: "First name", width: 130 },
  { field: "updated_at", headerName: "Last name", width: 130 },
  { field: "name", headerName: "Full name", width: 160 },
];

function ListAllEntries() {
  const [data, setData] = useState([]);
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      const threads = res;
      setData(threads);
    });
  }, []);

  return (
    <DashboardLayout>
      <Box mt={2} mb={1}>
        <Grid container spacing={1} justifyContent="center">
          <Grid item xs={12} lg={8}>
            <Card>
              <Box p={2}>
                <Typography variant="h5">API List All Entries</Typography>
              </Box>
              {data.map((object) => (
                <Grid
                  rows={object.data}
                  columns={columns}
                  pageSize={5}
                  checkboxSelection
                  disableSelectionOnClick
                />
              ))}
            </Card>
          </Grid>
        </Grid>
      </Box>
    </DashboardLayout>
  );
}
export default ListAllEntries;
